                        <span class="txt subheading-bold" style={this.styles.blue}>PARTNERSHIPS FOCUSED ON TECHNICAL DEVELOPMENT, TESTING AND TRIALS.</span>
                    </div>
                    <div class="col">
                        <img src={require("../images/overheard-bubble-partners.jpg")} alt="partners_image"/>
                    </div>
                </div>
            </div>
            <Footer/>
            </React.Fragment>
        );
    }
}
